description.value:
"Cette information permet de connaître : 
 - l’ancienneté du parc de logements d’habitation d’une commune ou d’un quartier; 
 - les caractéristiques de la population qui occupe les logements en fonction de cette ancienneté, de leur équipement et de leur localisation, pour prévoir les besoins futurs en matière de logements de la commune."

"Les informations sur l'année d'emménagement permettent de :
 - connaître les caractéristiques de la population en fonction de leur année d’arrivée dans la commune ou le quartier; 
 - étudier les flux migratoires de population dans une commune ou une région; 
- établir des statistiques de durée d’occupation des logements des habitants en fonction de leur statut d’occupation (propriétaires, locataires pour mesurer l’attractivité du quartier par exemple); 
 - planifier de nouvelles infrastructures et de nouveauxservices."
